import logo from './logo.svg';
import './App.css';
import Money from './Money';
import React, {useState} from 'react';
import { Button, Input, FormFeedback } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {

  const [screen, setScreen] = useState('result');
  const [getBill, setGetBill] = useState([]);
  const [getCoin, setGetCoin] = useState([[]]);
  const [withdrawAmount, setWithdraw] = useState('');

    const mainScreen = (

        <div className='mainScreen'>
          <center><p className='screenTitle'>Amount to withdraw</p></center>
          <center><Input bsSize="lg" placeholder='Enter amount' id='amount_input'/></center>
        </div>




    );

    const resultScreen = (
      <div className='inputField'>
      <center><p className='screenTitle'>Summary</p></center>
      <center>
          <tr>
              <th>
                  Withdraw:
              </th>
              <th>
                  {withdrawAmount}
              </th>
          </tr>
          { getCoin.length === 0 ? <tr></tr> :
                  <tr>
                  <th>
                      Coin
                  </th>
                  <th>
                      Amount
                  </th>
              </tr>

          }


              {getCoin.map((element) => 
                          <tr>
                              <td>{element[0]}</td>
                              <td>{element[1]}</td>
                          </tr>
                  )}
               { getBill.length === 0 ? <tr></tr> :
                  <tr>
                  <th>
                      Bill
                  </th>
                  <th>
                      Amount
                  </th>
              </tr>

          }

                  {getBill.map((element) => 
                      <tr>
                          <td>{element[0]}</td>
                          <td>{element[1]}</td>
                      </tr>
              )}

          </center>
  </div>
);


    const errorScreen = (
        <>error</>
    );

    const withdrawBtn = <Button color="danger" size="lg">Withdraw</Button>;
    const doneBtn = <Button color="success" size="lg">Done</Button>;
    const errorBtn =   <Button color="warning" size="lg">Back</Button>;

  return (
    <div className="App">
      <div className="AppBase">
        <div className='titleContainer'>
            <p className='title'>ATM V2</p>
        </div>

        <div className='moneyContainer'>
            <Money/>

            </div>
        <div className='contentContainer'> 

          <div className='Content'>
              {screen === 'main'? mainScreen : screen === 'result' ? resultScreen : errorScreen}
          </div>

        </div>
        <div className='buttonContainer'> 
          <div className='button'>
            {screen === 'main'? withdrawBtn : screen === 'result' ? doneBtn : errorBtn}
          </div>
          </div>
      </div>
      </div>


  );
}

export default App;
